import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import Header from './components/Heaeder';
import NotesListPage from './pages/NotesListPage'

function App() {
  return (
    <Router>
        <div className="App">
          <Header />
          <Routes>
            <Route path="/" element={<NotesListPage/>} />  
          </Routes> 
        </div>
    </Router>
  );
}

export default App;
